INSERT INTO `movie` VALUES (448,6960,NULL,'D:\\uTorrent downloads\\[Xvid DVDRip Fr] Retour Vers Le Futur.avi','1985. Le jeune Marty McFly mène une existence anonyme auprès de sa petite amie Jennifer, seulement troublée par sa famille en crise et un proviseur qui serait ravi de l\'expulser du lycée. Ami de l\'excentrique professeur Emmett Brown, il l\'accompagne un soir tester sa nouvelle expérience : le voyage dans le temps <i>via</i> une DeLorean modifiée. La démonstration tourne mal : des trafiquants d\'armes débarquent et assassinent le scientifique. Marty se réfugie dans la voiture et se retrouve transporté en 1955. Là, il empêche malgré lui la rencontre de ses parents, et doit tout faire pour les remettre ensemble, sous peine de ne pouvoir exister...','Retour vers le futur',1985,25,25,25,25,'\0'),(1341,5580,NULL,'D:\\Films\\UNE CREATURE DE REVE.avi','Deux lycéens pas populaires ne parviennent pas à être acceptés par leurs camarades (et surtout pas les filles) malgré tous leurs efforts. Ils créent alors un programme informatique qui donne naissance à la femme parfaite. Grâce à cette invention, ils retrouvent confiance en eux.','Une créature de rêve',1985,33,33,33,33,'\0'),(9257,7500,NULL,'D:\\uTorrent downloads\\Madame Doubtfire 1993 720p BluRay Multi DTS x264-GAIA.mkv','Privé, à la suite de son divorce, de ses trois enfants qu\'il adore, Daniel Hillard, doubleur de dessins animés, met en oeuvre tous ses talents d\'acteur et d\'imitateur et se transforme en respectable gouvernante irlandaise. Lorsque Mme Doubtfire se presente dans la famille Hillard, elle est acceptée a l\'unanimité.','Madame Doubtfire',1993,61,61,61,61,'\0'),(9895,6480,NULL,'D:\\Films\\Rasta Rocket.avi','Comment une équipe de la Jamaïque, après de multiples aventures, va remporter l\'épreuve de bobsleigh à quatre aux Jeux Olympiques d\'hiver de Calgary.','Rasta rockett',1993,28,28,28,28,'\0'),(10126,8940,NULL,'D:\\uTorrent downloads\\Pulp Fiction\\Pulp Fiction.mp4','L\'odyssée sanglante et burlesque de petits malfrats dans la jungle de Hollywood à travers trois histoires qui s\'entremêlent.','Pulp Fiction',1994,14,14,14,14,'\0'),(13402,6000,NULL,'D:\\uTorrent downloads\\Les.Trois.Frere\\Les.Trois.Frere.avi','Le même jour, trois hommes découvrent qu\'ils sont frères et héritent de 3 millions. Mais dix jours plus tard, l\'héritage est détourné... et la galère commence pour trois frères qui n\'ont que faire d\'être frères.','Les trois frères',1995,48,48,48,48,'\0'),(14914,6000,NULL,'D:\\uTorrent downloads\\very bad things dvdrip xvid fr ac3.avi','Quelques jours avant son mariage avec Laura, Kyle décide d\'enterrer sa vie de garçon avec quelques copains, lesquels organisent une virée à Las Vegas. Laura voit d\'un mauvais œil cette sortie, obsédée par un mariage qu\'elle attend depuis toujours. La fête tourne au cauchemar quand Michael tue accidentellement une prostituée engagée pour animer la soirée. Entrainé par Boyd, le groupe d\'amis décide de ne pas avertir la police et d\'enterrer le cadavre dans le désert. C\'est alors le début d\'une spirale infernale.','Very Bad Things',1998,54,54,54,54,'\0'),(15037,6780,NULL,'D:\\Films\\Twister.mkv','Les exploits quotidiens et méconnus d\'un groupe de scientifiques, chasseurs de tornades du Midwest aux Etats-Unis. Jo Harding, qui a vu son père emporté par une tornade quand elle était enfant, sillonne inlassablement les routes du Midwest à la tête d\'une petite équipe de météorologues, aventuriers et casse-cou, unis autour d\'un même objectif : observer les tornades sur leur terrain d\'élection.','Twister',1996,32,32,32,32,'\0'),(18602,6600,NULL,'D:\\Films\\Small Soldiers.avi','Alan Abernathy est un adolescent trop remuant pour la petite bourgade de l\'Ohio où il habite. Expulsé du lycée pour une innocente plaisanterie, il aimerait se racheter aux yeux de son père, marchand de jouets. Un jour où son père part en voyage d\'affaires, il prend sur lui de renouveler un stock de jouets désuets. C\'est ainsi qu\'il obtient une douzaine de figurines d\'action : un commando d\'élite super-musclé et une tribu de monstres patauds, les Gorgonites. Comment pouvait-il se douter que ces charmants jouets étaient programmés pour s\'entretuer et semer la panique ?','Small Soldiers',1998,30,30,30,30,'\0'),(20153,7500,NULL,'D:\\uTorrent downloads\\La Momie Truefrench Subforced Dvdrip.Xvid-Isisatis.avi','Longtemps avant la naissance du Christ, pour avoir osé défier le pharaon en lui ravissant sa jeune maîtresse, le grand prêtre de Thèbes, Imhotep, est momifié vivant et enseveli dans une crypte secrète d\'Hamunaptra, la cité des morts. Du fond de son sarcophage, le grand prêtre jure de se venger du genre humain. En 1923, un aventurier américain, Rick O\'Connell, découvre fortuitement les ruines d\'Hamunaptra que des générations d\'égyptologues recherchaient en vain. Il met dans le secret une jeune égyptologue et son frère et tous trois partent à la recherche du trésor des pharaons.','La Momie',1999,76,76,76,76,'\0'),(21608,5700,NULL,'D:\\uTorrent downloads\\American Pie - Saga\\American Pie (1999)\\American Pie.mkv','Mortifié pour avoir été surpris par ses parents devant un film X, Jim, élève de terminale, fait un pacte avec sa bande de copains : ils doivent devenir des hommes avant leur entrée à la fac. Il leur reste trois semaines pour utiliser toutes les techniques possibles de séduction. Tous les moyens sont bons, même les plus inattendus, car chaque jour compte. Une chose est sûre, Jim ne regardera plus jamais une tarte aux pommes de la même façon !','American Pie',1999,12,12,12,12,'\0'),(28846,6060,NULL,'D:\\Films\\Resident Evil.avi','Dans un immense laboratoire souterrain, ont lieu des recherches ultras secrètes, supervisées par des centaines de scientifiques. Lorsque l\'alarme retentit, tout le monde croit à une simple simulation d\'évacuation. Mais bientôt, l\'horreur les rattrape. Un virus hautement mortel se propage à un rythme effréné dans les couloirs : en quelques minutes, il met fin à toute vie humaine.<br /> <br />Au même moment, Alice se réveille dans un somptueux manoir. Ignorant comment elle a pu atterrir là, elle fait la rencontre de Matt, un policier. Avant même qu\'ils n\'aient pu trouver une explication logique à ces phénomènes étranges, un groupe d\'intervention militaire, les S.T.A.R.S, débarque de nulle part et les oblige à les suivre. Ces derniers ont reçu l\'ordre d\'infiltrer le laboratoire et de neutraliser la <i>Red Queen</i>, le super-ordinateur devenu fou que l\'on tient pour responsable du désastre.','Resident Evil',2002,29,29,29,29,'\0'),(29279,6300,NULL,'D:\\uTorrent downloads\\American Pie - Saga\\American  Pie 2 (2001)\\American  Pie 2.mkv','Un an après leur sortie du collège, le naïf Jim et ses copains Oz, Kevin et Finch se retrouvent pour des vacances d\'été qu\'ils espèrent torrides. Leur nid d\'amour - un bungalow au bord du lac Michigan - n\'attend plus que l\'arrivée et le bon vouloir des filles : la rousse Heather, la tendre Nadia, Michelle la flûtiste, la sage Jessica et l\'élégante Vicky.<br /> Mais les choses ont évolué ces derniers mois, remettant en question les rêves et les espoirs de cette ardente jeunesse. A la suite d\'un énième fiasco, Jim constate avec dépit qu\'il ne suffit pas d\'avoir perdu sa virginité pour être un séducteur ; Oz le nonchalant doit stoïquement s\'accommoder de l\'éloignement de sa chère Heather ; Kevin se demande s\'il se contentera longtemps de n\'être que le bon ami de Vicky, tandis que Finch potasse avec ardeur le Kama Sutra dans l\'espoir fallacieux d\'asservir à jamais la mère de l\'ignoble Stifler.','American Pie 2',2000,16,16,16,16,'\0'),(41134,7140,NULL,'D:\\Films\\Les chroniques de riddick.avi','Une lourde menace pèse sur l\'univers. Planète après planète, les féroces Necromongers étendent leur empire, ne laissant aux populations conquises qu\'une alternative : se convertir ou mourir. Et c\'est ainsi que le plus improbable sauveur de la galaxie est tiré de son exil et appelé 