ack est retenu...','Pirates des Caraïbes : Jusqu\'au Bout du Monde',2007,73,73,73,73,'\0'),(57732,5700,NULL,'D:\\uTorrent downloads\\[ www.CpasBien.pw ] Pourquoi.Jai.Pas.Mange.Mon.Pere.2015.FRENCH.DVDRiP.XViD-AViTECH.avi','L’histoire trépidante d’Édouard, fils aîné du roi des simiens, qui, considéré à sa naissance comme trop malingre, est rejeté par sa tribu. Il grandit loin d’eux, auprès de son ami Ian, et, incroyablement ingénieux, il découvre le feu, la chasse, l’habitat moderne, l’amour et même… l’espoir. Généreux, il veut tout partager, révolutionne l’ordre établi, et mène son peuple avec éclat et humour vers la véritable humanité… celle où on ne mange pas son père.','Pourquoi j\'ai pas mangé mon père',2015,52,52,52,52,'\0'),(59200,6000,NULL,'D:\\Films\\Playboy a saisir DVDRip.avi','Il a (presque) toutes les qualités qui font rêver les femmes. Il est beau, viril, élégant, dynamique, intelligent, sportif, sympa et plein d\'humour. Il aime la vie, il aime les gens, il aime ses copains, il aime ses parents...un peu trop même car à 35 ans, cet \"adulescent\" modèle n\'a pas encore \"décollé\" et \"rompu le cordon\".<br />\r\nMais comment faire déguerpir gentiment un grand garçon qui commence à prendre de la place dans votre appartement ? En lui faisant la gueule ? En lui imposant des corvées ménagères? En le rançonnant ? En lui confisquant ses gadgets ? En le privant de dessert? En engageant la femme de ses rêves. Et c\'est ainsi que Paula fait son entrée dans la vie de Tripp...','Playboy à saisir',2006,41,41,41,41,'\0'),(61256,6240,NULL,'D:\\uTorrent downloads\\Fast and furious - Tokyodrift\\Fast and furious - Tokyodrift.avi','Sean Boswell est un risque-tout à qui sa passion immodérée des voitures de sport trafiquées a déjà attiré de sérieux ennuis avec la police californienne. Condamné après un accident, sa seule alternative à la prison est d\'accepter la tutelle de son père, militaire de carrière basé à Tokyo.<br /><i>Gaijin</i> (étranger) dans la ville la plus 