. La tension entre extraterrestres et humains atteint son maximum lorsque le MNU commence à évacuer les non-humains du District 9 vers un nouveau camp, en envoyant des agents de terrain s\'occuper de leur transfert. L\'un de ces agents, Wikus van der Merwe, contracte un virus extraterrestre qui se met à modifier son ADN. Wikus est à présent l\'homme le plus recherché de la planète, celui qui vaut plus qu\'une fortune : il est la clé qui permettra de percer le secret de la technologie alien.Repoussé, isolé, sans aide ni amis, il ne lui reste qu\'un seul endroit où se cacher : le District 9...','District 9',2009,27,27,27,27,'\0'),(143276,7380,NULL,'D:\\Films\\Valentine\'s Day.avi','Les destins croisés de couples qui se séparent ou se retrouvent, de célibataires qui se rencontrent à Los Angeles, le jour de Saint-Valentin...','Valentine\'s Day',2010,34,34,34,34,'\0'),(144148,7260,NULL,'D:\\Films\\Total recall.avi','Modeste ouvrier, Douglas Quaid rêve de s’évader de sa vie frustrante. L’implantation de souvenirs que propose la société Rekall lui paraît l’échappatoire idéale. S’offrir des souvenirs d’agent secret serait parfait… Mais lorsque la procédure d’implantation tourne mal, Quaid se retrouve traqué par la police. Il ne peut plus faire confiance à personne, sauf peut-être à une inconnue qui travaille pour une mystérieuse résistance clandestine. Très vite, la frontière entre l’imagination et la réalité se brouille. Qui est réellement Quaid, et quel est son destin ?','Total Recall Mémoires Programmées',2012,31,31,31,31,'\0'),(178061,7800,NULL,'D:\\uTorrent downloads\\Fast.and.Furious.5.(2011).HDLight.720p.x264.MULTI.VFF.VO.AC3.5.1.MULTISUBS.FR.EN.[ABIBOUBA].mkv','Depuis que Brian et Mia Toretto ont extirpé Dom des mains de la justice, ils ont dû franchir de nombreuses frontières pour échapper aux autorités. Retirés à Rio, ils sont contraints de monter un dernier coup pour se faire blanchir et recouvrer leur liberté. Ils se constituent une équipe d\'élite, réunissant les pilotes les plus avertis, conscients que leur seule chance d\'être acquittés pour bonne conduite nécessite une confrontation avec l\'homme d\'affaires véreux qui souhaite les voir morts. Mais il n\'est pas le seul à leurs trousses. L\'impitoyable agent fédéral Luke Hobbs n\'a jamais loupé sa cible. Affecté à la traque des fugitifs, lui et son équipe de choc élaborent un implacable dispositif d\'assaut destiné à les capturer. Passant le Brésil au crible, Hobbs réalise combien la frontière qui sépare les bons des méchants est ténue. Il doit alors s\'en remettre à son instinct pour acculer ses proies et éviter qu\'un autre ne les débusque avant lui.','Fast and Furious 5',2011,65,65,65,65,'\0'),(180157,7080,NULL,'D:\\uTorrent downloads\\Crazy Stupid Love (2011) [1080p] BluRay MULTi x264-PopHD.mkv','A tout juste quarante ans, Cal Weaver mène une vie de rêve - bonne situation, belle maison, enfants formidables et mariage parfait avec sa petite amie du lycée. Mais lorsqu’il apprend que sa femme, Emily, le trompe et demande le divorce, sa vie « parfaite » s’écroule. Pire, dans le monde des célibataires d’aujourd’hui, Cal, qui n’a plus dragué depuis des lustres, se révèle un modèle d’anti séduction. Passant désormais ses soirées à bouder tout seul au bar du coin, l’infortuné Cal est pris en main comme complice et protégé d’un séduisant trentenaire, Jacob Palmer. Pour l’aider à oublier sa femme et à commencer une nouvelle vie, Jacob tente de faire découvrir à Cal les nombreuses perspectives qui s’offrent à lui : femmes en quête d’aventures, soirées arrosées entre copains et un chic supérieur à la moyenne.<br/>Cal et Emily ne sont pas les seuls en quête d’amour: le fils de Cal, Robbie, 13 ans, est fou de sa babysitter de 17 ans, Jessica, laquelle a jeté son dévolu… sur Cal ! Et en dépit de la transformation de Cal et de ses nombreuses nouvelles conquêtes, la seule chose qu’il ne peut changer reste son coeur, qui semble toujours le ramener à son point de départ.','Crazy, Stupid, Love',2011,70,70,70,70,'\0'),(185030,6780,NULL,'D:\\Films\\Edge of Tomorrow (2014) [1080p] MULTi BluRay x264-PopHD.mkv','Dans un futur proche, des hordes d\'extraterrestres ont livré une bataille acharnée contre la Terre et semblent désormais invincibles: aucune armée au monde n\'a réussi à les vaincre. Le commandant William Cage, qui n\'a jamais combattu de sa vie, est envoyé, sans la moindre explication, dans ce qui ressemble à une mission-suicide. Il meurt en l\'espace de quelques minutes et se retrouve projeté dans une boucle temporelle, condamné à revivre le même combat et à mourir de nouveau indéfiniment…<br/><br/>','Edge Of Tomorrow',2014,39,39,39,39,'\0'),(188521,6840,NULL,'D:\\uTorrent downloads\\American Pie - Saga\\American Pie 4 ( 2012)\\American Pie 4.mkv','Comme le temps passe…Souvenez-vous de cette année 1999 où quatre lycéens d’une petite ville du Michigan décidèrent d’en finir avec… leur virginité. Quête héroïque, burlesque, inoubliable… Une décennie plus tard, Jim (Jason Biggs) et Michelle (Alyson Hannigan) sont mariés, Kevin (Thomas Ian Nicholson) et Vicky (Tara Reid) sont séparés, Oz (Chris Klein) et Heather (Mena Suvari) se sont éloignés à contrecœur, tandis que Finch (Eddie Kaye Thomas) soupire encore après… l’extravagante mère de Stifler (Jennifer Coolidge). Quant à Stifler (Seann William Scott), rien ne le changera jamais. Amis d’hier, amis de toujours, ces jeunes hommes attendaient depuis longtemps de pouvoir se réunir le temps d’un week-end pour se remémorer leurs exploits d’antan et y puiser de nouvelles inspirations. Que la fête commence, l’heure du checkup hormonal a sonné…','American Pie 4',2012,35,35,35,35,'\0'),(189651,7800,NULL,'D:\\uTorrent downloads\\Fast.and.Furious.6.2013.FRENCH.BluRay.720p\\Fast.and.Furious.6.2013.FRENCH.BluRay.720p.avi','<p>Dom, Brian et toute leur équipe, après le casse de Rio, ayant fait tomber un empire en empochant 100 millions de dollars, se sont dispersés aux quatre coins du globe. Mais l’incapacité de rentrer chez eux, et l’obligation de vivre en cavale permanente, laissent à leur vie le goût amer de l’inaccomplissement. Pendant ce temps Hobbs traque aux quatre coins du monde un groupe de chauffeurs mercenaires aux talents redoutables, dont le meneur, Shaw est secondé d’une de main de fer par l’amour que Dom croyait avoir perdu pour toujours : Letty. La seule façon d’arrêter leurs agissements est de les détrôner en surpassant leur réputation. Hobbs demande donc à Dom de rassembler son équipe de choc à Londres. En retour ? Ils seront tous graciés et pourront retourner auprès des leurs, afin de vivre une vie normale.<br/><br/></p>','Fast & Furious 6',2013,49,49,49,49,'\0'),(190299,5880,NULL,'D:\\Films\\Moi Moche et Me?chant 2 [1080p] MULTI 2013 BluRay x264-Pop.Despicable Me 2. .mkv','<p style=\"text-align: justify;\">Ayant abandonnÃ© la super-criminalitÃ© et mis de cÃ´tÃ© ses activitÃ©s funestes pour se consacrer Ã  la paternitÃ© et Ã©lever Margo, Ã‰dith et AgnÃ¨s, Gru, et avec lui, le Professeur NÃ©fario et les Minions, doivent se trouver de nouvelles occupations. Alors quâ€™il commence Ã  peine Ã  sâ€™adapter Ã  sa nouvelle vie tranquille de pÃ¨re de famille, une organisation ultrasecrÃ¨te, menant une lutte acharnÃ©e contre le Mal Ã  lâ€™Ã©chelle planÃ©taire, vient frapper Ã  sa porte. Soudain, câ€™est Ã  Gru, et Ã  sa nouvelle coÃ©quipiÃ¨re Lucy, que revient la responsabilitÃ© de rÃ©soudre une sÃ©rie de mÃ©faits spectaculaires. AprÃ¨s tout, qui mieux que lâ€™ex plus mÃ©chant mÃ©chant de tous les temps, pourrait attraper celui qui rivalise pour lui voler la place quâ€™il occupait encore rÃ©cemment.<br/>Rejoignant nos hÃ©ros, on dÃ©couvre : Floyd, le propriÃ©taire du salon Eagle Postiche Club pour hommes et suspect numÃ©ro 1 du crime le plus abject jamais perpÃ©trÃ© depuis le dÃ©part de Gru Ã  la retraite ; Silas de LamolefÃ¨s, le super-espion Ã  la tÃªte de lâ€™Agence Vigilance de Lynx, patron de Lucy, dont le nom de famille est une source inÃ©puisable dâ€™amusement pour les Minions ; Antonio, le si mielleux objet de lâ€™affection naissante de Margo, et Eduardo Perez, le pÃ¨re dâ€™Antonio, propriÃ©taire du restaurant Salsa & Salsa et lâ€™homme qui se cache peut-Ãªtre derriÃ¨re le masque dâ€™El Macho, le plus impitoyable et, comme son nom lâ€™indique, mÃ©chant macho que la terre ait jamais portÃ©.</p>','Moi, moche et mÃ©chant 2',2013,78,78,78,78,'\0'),(192186,8460,NULL,'D:\\Films\\The Amazing Spider-Man 2.avi','<p>Ce n’est un secret pour personne que le combat le plus rude de Spider-Man est celui qu’il mène contre lui-même en tentant de concilier la vie quotidienne de Peter Parker et les lourdes responsabilités de Spider-Man. Mais Peter Parker va se rendre compte qu’il fait face à un conflit de bien plus grande ampleur. Être Spider-Man, quoi de plus grisant ? Peter Parker trouve son bonheur entre sa vie de héros, bondissant d’un gratte-ciel à l’autre, et les doux moments passés aux côté de Gwen. Mais être Spider-Man a un prix : il est le seul à pouvoir protéger ses concitoyens new-yorkais des abominables méchants qui menacent la ville.  Face à Electro, Peter devra affronter un ennemi nettement plus puissant que lui.  Au retour de son vieil ami Harry Osborn, il se rend compte que tous ses ennemis ont un point commun : OsCorp.<br/><br/></p>','The Amazing Spider-Man : le destin d\'un Héros',2014,40,40,40,40,'\0'),(193877,6240,NULL,'D:\\uTorrent downloads\\[www.Cpasbien.me] Un.Plan.Parfait.2012.FRENCH.BRRip.XviD-TMB\\[www.Cpasbien.me] upp.tmb.avi','Pour contourner la malédiction qui anéantit tous les premiers mariages de sa famille, Isabelle a une stratégie pour épouser l\'homme qu\'elle aime : trouver un pigeon, le séduire, l’épouser et divorcer.<br/>Un plan parfait si la cible n’était l\'infernal Jean-Yves Berthier, rédacteur pour un guide touristique, qu\'elle va suivre du Kilimandjaro à Moscou.<br/>Un périple nuptial pour le meilleur et surtout pour le pire.','Un Plan Parfait',2012,51,51,51,51,'\0'),(195022,8340,NULL,'D:\\Films\\Divergent.2014.TRUEFRENCH.BRRip.XviD-UTT.avi','<p>Tris vit dans un monde post-apocalyptique où la société est divisée en cinq clans (Audacieux, Érudits, Altruistes, Sincères, Fraternels). À 16 ans, elle doit choisir son appartenance pour le reste de sa vie. Cas rarissime, son test d’aptitude n’est pas concluant : elle est Divergente. Les Divergents sont des individus rares n’appartenant à aucun clan et sont traqués par le gouvernement. Dissimulant son secret, Tris intègre l’univers brutal des Audacieux dont l’entraînement est basé sur la maîtrise de nos peurs les plus intimes.</p>','Divergente',2014,38,38,38,38,'\0'),(201760,7380,NULL,'D:\\uTorrent downloads\\Il.était temps.HDrip.Vff.720p.X264.AC3 .mkv','<p style=\"text-align: justify;\">À l’âge de 21 ans, Tim Lake découvre qu’il a la capacité de voyager dans le temps... Lors de la nuit d’un énième nouvel an particulièrement raté, le père de Tim apprend à son fils que depuis des générations tous les hommes de la famille maîtrisent le voyage intertemporel. Tim ne peut changer l’histoire, mais a le pouvoir d’interférer dans le cours de sa propre existence, qu’elle soit passée ou à venir... Il décide donc de rendre sa vie meilleure... en se trouvant une amoureuse. Malheureusement les choses s’avèrent plus compliquées que prévu. Tim quitte les côtes de la Cornouailles pour faire un stage de droit à Londres et rencontre la belle et fragile Mary. Alors qu’ils tombent amoureux l’un de l’autre, un voyage temporel malencontreux va effacer cette rencontre. C’est ainsi qu’au fil de ses innombrables voyages temporels il n’a de cesse de ruser avec le destin afin de la rencontrer pour la première fois, encore et encore, jusqu’à ce qu’il arrive à gagner son coeur. Tim se sert alors de son pouvoir afin de créer les conditions idéales pour la demande en mariage parfaite, pour sauver la cérémonie à venir du discours catastrophique du pire des garçons d’honneur imaginable mais aussi pour épargner à son meilleur ami un désastre professionnel. Mais alors que le cours de sa vie inhabituelle se déroule, Tim découvre que ce don exceptionnel ne lui épargne pas la peine et les chagrins qui sont communs à n’importe quelle autre famille partout ailleurs.</p>','Il était temps',2013,77,77,77,77,'\0'),(206559,6300,NULL,'D:\\uTorrent downloads\\Diversion - 2015 FRENCH 1080p BluRay x264-MisterB.mkv','La relation entre un arnaqueur professionnel et une apprentie criminelle vient perturber les affaires de chacun, quand ils se recroisent quelques années après leur première rencontre.','Diversion',2015,56,56,56,56,'\0'),(209664,5760,NULL,'D:\\uTorrent downloads\\Amours.Et.Turbulences.2013.FRENCH.BDRIP.XVID-ATN\\Amours.Et.Turbulences.2013.FRENCH.BDRIP.XVID-ATN.avi','Alors qu\'un avion la ramène de New-York à Paris où elle s\'apprête à se marier, la belle Julie se retrouve assise à côté d\'Antoine, un séduisant débauché qu\'elle a aimé 3 ans plus tôt. Elle va tout faire pour l’éviter alors qu\'il compte sur ces 7 h de vol pour la reconquérir! L\'occasion pour nous de voyager dans le passé et de revivre leur rencontre, leur amour, leur rupture, autant de scènes rocambolesques, romantiques et corrosives qui vont faire de ce voyage le plus bouleversant de leur vie.','Amour & turbulences',2013,68,68,68,68,'\0'),(210785,6300,NULL,'D:\\uTorrent downloads\\Aloha.2015.TRUEFRENCH.BRRip.XviD.AC3-SVR.avi','Un militaire de renom retourne sur les terres où il a connu les plus grands succès de sa carrière. Alors qu’il renoue des liens avec un amour de jeunesse, il tombe contre toute attente sous le charme d’une militaire de l’Air Force qu’on lui a assigné.','Welcome Back',2015,67,67,67,67,'\0'),(228537,5100,NULL,'D:\\uTorrent downloads\\[ www.CpasBien.pw ] Papa.ou.Maman.2015.FRENCH.720p.BluRay.x264-FiDO.mkv','Florence et Vincent Leroy ont tout réussi. Leurs métiers, leur mariage, leurs enfants. Et aujourd’hui, c’est leur divorce qu’ils veulent réussir. Mais quand ils reçoivent simultanément la promotion dont ils ont toujours rêvée, leur vie de couple vire au cauchemar. Dès lors, plus de quartier, les ex-époux modèles se déclarent la guerre : et ils vont tout faire pour NE PAS avoir la garde des enfants.','Papa ou maman',2015,58,58,58,58,'\0'),(231434,7980,NULL,'D:\\uTorrent downloads\\Le Labyrinthe La Terre brulee (2015) Maze Runner The Scorch Trials - Multi 1080p BluRay - x264 AAC 5.1 - CCATS.mkv','Dans ce second volet de la saga épique LE LABYRINTHE, Thomas et les autres Blocards vont devoir faire face à leur plus grand défi, rechercher des indices à propos de la mystérieuse et puissante organisation connue sous le nom de WICKED. Or le monde qu’ils découvrent à l’extérieur du Labyrinthe a été ravagé par l’Apocalypse. Leur périple les amène à la Terre Brûlée, un paysage de désolation rempli d\'obstacles inimaginables. Plus de gouvernement, plus d\'ordre… et des hordes de gens en proie à une folie meurtrière qui errent dans les villes en ruine. Les Blocards vont devoir unir leurs forces avec d\'autres combattants pour pouvoir affronter WICKED et tenter de défier son immense pouvoir.','Le Labyrinthe : La Terre brûlée',2015,75,75,75,75,'\0'),(232552,5400,NULL,'D:\\uTorrent downloads\\400 Days 2015 1080p FR x264 AC3 mHDgz.mkv','<span>Quatre astronautes sont enfermés dans un simulateur pour tester les effets psychologiques d\'un voyage dans l\'espace. Lorsqu\'ils en ressortent finalement, après 400 jours qui ont vu leur état mental se dégrader, ils découvrent qu\'on ne leur a pas tout dit sur cette mission de simulation...</span>','400 Days',2015,74,74,74,74,'\0');
